import styles from '../styles/Contact.module.css';

function Contact() {
    return (
            <div className="wrapper">
                <section className={styles.about}>
                    <h2 className={styles.headers}>Contact</h2>
                    <p>Call my numba! 555-5555</p>
                </section>
            </div>
        );
    }

    export default Contact;
